import{_ as e,c as t,o as s,d as o}from"./app.289883e3.js";const m=JSON.parse('{"title":"Object Sets","description":"","frontmatter":{},"headers":[],"relativePath":"docs/object-sets.md","lastUpdated":1681115294000}'),a={name:"docs/object-sets.md"},c=o('<h1 id="object-sets" tabindex="-1">Object Sets <a class="header-anchor" href="#object-sets" aria-hidden="true">#</a></h1><p>Object Sets in Sapiens are groupings of objects that are maintained at runtime. All logic related to object sets can be found within <code>serverGOM.lua</code>.</p><p>An example object set is <code>litKilns</code>, or <code>temperatureIncreasers</code>. Objects can be added to object sets at runtime (such as when a kiln is lit), and then other systems can loop over objects in the set, and perform actions on them.</p><p>Helpful methods to work with object sets include:</p><ul><li>serverGOM:createObjectSet</li><li></li></ul>',5),n=[c];function r(i,d,l,_,p,h){return s(),t("div",null,n)}const u=e(a,[["render",r]]);export{m as __pageData,u as default};
